// HasSpaces applies the HasEdge predicate on the "spaces" edge.
func HasSpaces() predicate.User {
	return predicate.User(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.M2M, false, SpacesTable, SpacesPrimaryKey...),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasSpacesWith applies the HasEdge predicate on the "spaces" edge with a given conditions (other predicates).
func HasSpacesWith(preds ...predicate.Space) predicate.User {
	return predicate.User(func(s *sql.Selector) {
		step := newSpacesStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// HasSpaceAssignment applies the HasEdge predicate on the "space_assignment" edge.
func HasSpaceAssignment() predicate.User {
	return predicate.User(func(s *sql.Selector) {
		step := sqlgraph.NewStep(
			sqlgraph.From(Table, FieldID),
			sqlgraph.Edge(sqlgraph.O2M, true, SpaceAssignmentTable, SpaceAssignmentColumn),
		)
		sqlgraph.HasNeighbors(s, step)
	})
}

// HasSpaceAssignmentWith applies the HasEdge predicate on the "space_assignment" edge with a given conditions (other predicates).
func HasSpaceAssignmentWith(preds ...predicate.SpaceUserAssignment) predicate.User {
	return predicate.User(func(s *sql.Selector) {
		step := newSpaceAssignmentStep()
		sqlgraph.HasNeighborsWith(s, step, func(s *sql.Selector) {
			for _, p := range preds {
				p(s)
			}
		})
	})
}

// And groups predicates with the AND operator between them.
func And(predicates ...predicate.User) predicate.User {
	return predicate.User(sql.AndPredicates(predicates...))
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.User) predicate.User {
	return predicate.User(sql.OrPredicates(predicates...))
}

// Not applies the not operator on the given predicate.
func Not(p predicate.User) predicate.User {
	return predicate.User(sql.NotPredicates(p))
}
